import React, {useState} from "react";


const InputElement = () => {
    const [inputEntered, setInputEntered] = useState("");
    return <div>
    <input 
    onChange={(e) => {setInputEntered(e.target.value)}}
    placeholder="Enter some text"/>
    <br/>
    {inputEntered}
    </div>
};

export default InputElement;
